def filter(input, output, data):

    b = input.read(1)
    i = 0
    ilen = len(data)
    
    while b:
        output.write(b)
        
        if i == ilen - 1:
            sys.stderr.write("eureka!\n")
            break

        byte_val = struct.unpack('B', b)[0]
        
        if byte_val != data[i]:
            break

        i += 1
        
        b = input.read(1)

        pass

    return b

